import { useState } from "react";
import HomePage from "./HomePage";
import Resource from "./Resource";

function LeftPanel() {
    const [view, setView] = useState(0);

    const renderPage = () => {
        if (view == 0) {
            <HomePage />
        }
        if (view == 1) {
            <Resource />
        }
    }

    return (
        <>
            <div className="sidenav">
                <p onClick={() => setView(0)}><a href="#"><i className="bi bi-house"></i> Home</a></p>
                <p onClick={() => setView(1)}><a href="#"><i className="bi bi-alarm"></i> My products and flightpaths</a></p>
                <p onClick={() => setView(2)}><a href="#"><i className="bi bi-heart"></i> Resources</a></p>
            </div>
            <div>
                renderPage();
            </div>
        </>
    );
}

export default LeftPanel;
